import React from 'react';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Button1 from '@material-ui/core/Button';
import {green, purple} from '@material-ui/core/colors';



const AddNewList = withStyles(theme => ({
    root: {
        color: theme.palette.getContrastText(purple[500]),
        backgroundColor: purple[400],
        '&:hover': {
            backgroundColor: purple[500],
        },
    },
}))(Button);

const GoBack = withStyles(theme => ({
    root: {
        color: theme.palette.getContrastText(green[500]),
        backgroundColor: green[400],
        '&:hover': {
            backgroundColor: green[500],
        },
    },
}))(Button1);

const useStyles = makeStyles(theme => ({
    margin: {
        margin: theme.spacing(1),
    },
}));

export default function  AddNewListButton (props){
    const classes = useStyles();

    return (
        <div>
            <AddNewList variant="contained" color="primary" className={classes.margin}>
                {props.ButtonName}
            </AddNewList>
        </div>
    );
}


export function  GoBackButton(props){
    const classes = useStyles();
    return (
        <div>
            <GoBack variant="contained" color="primary" className={classes.margin}>
                {props.ButtonName}
            </GoBack>
        </div>
    );
}
